  //         <li><Link to="/register">Register</Link></li>
  //       </ul>
  //     </nav>
  //   </div>

    return (
        <div>
          <button onClick={handleClick}>Show Members</button>
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Membership Start Date</th>
                <th>Membership End Date</th>
              </tr>
            </thead>
            <tbody>
              {members.map(member => (
                <tr key={member._id}>
                  <td>{member.name}</td>
                  <td>{member.email}</td>
                  <td>{member.membership_start_date}</td>
                  <td>{member.membership_end_date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );
};

export default Home;
